import React from 'react';
import { Link } from 'react-router-dom';
import { Navbar, Nav, NavItem } from "react-bootstrap";

class Navigation extends React.Component {
	render() {
    return(
      <Navbar default collapseOnSelect>
        <Navbar.Header>
          <Navbar.Brand>
            <Link to="/">adkjfal</Link>
          </Navbar.Brand>
          <Navbar.Toggle/>
        </Navbar.Header>
        <Navbar.Collapse>
          <Nav pullRight>
            <NavItem eventKey={1} componentClass={Link} to="/">
              Home
            </NavItem>
            <NavItem eventKey={2} componentClass={Link} to="/resident">
              Resident
            </NavItem>
            <NavItem eventKey={3} componentClass={Link} to="/guest">
              Invitado
            </NavItem>
            <NavItem eventKey={4} componentClass={Link} to="/depositWithdraw">
              depositWithdraw
            </NavItem>
          </Nav>
        </Navbar.Collapse>
      </Navbar>
    );
  }
}

export default Navigation;
